import React, { Component } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.css";
import FAQMain from "./components/FAQ/FAQ_1_main";
import FAQForm from "././components/FAQ/FAQ_2_form"

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          <Routes>
            <Route path="/" element={<FAQMain />}>
              <Route path="form" element={<FAQform />} />
            </Route>
          </Routes>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
